22.description:
Полностью алюминиевый корпус,
Win 11 original,
Подсветка клавиатуры,
Двойная HD камера с датчиками FACE ID,
Звук Bang & Olufsen - авто настраиваемый супер чувствительный микрофон для конференций и HD звук с кучей настроек (74 dB);
Тачпад с мульти тач - очень удобно: одним, двумя и тремя пальцами жесты - и мышка вам не нужна!
Экран идеальный;
Элитный и очень приятный дорогой ноутбук!

Intel Core i5-8350U 3.6 GHz with Intel Turbo Boost Technology; 6 MB cache, 4 cores 8 flows;
35.56 cm (14.0 in) diagonal FHD IPS anti-glare LED-backlit, 220 cd/m2, 45% sRGB with HD IR webcam for WWAN (1920 x 1080);
8 GB DDR4-2400 SDRAM (4 GB x 2);
256 GB NVMe M.2 SSD;
Thunderbolt (USB Type-C connector);
USB 3.1;
HDMI 1.4b port;
Dual Band Wireless 802.11a/b/g/n/ac (2x2) Wi-Fi and Bluetooth 4.2;
Absolute Persistence Module - защита от кражи

